const EventsHeader = styled.h1`
  display: flex;
  justify-content: center;
  align-items: flex-end;
  font-size: 7rem;
  font-weight: 600;
  background-color: white;
  width: 100vw;
  padding: 1rem 0;
  position: sticky;
  top: 0;
`;

const EventContainer = styled.li`
  display: flex;
  width: 100%;
  height: var(--mobil-screen);
  flex-direction: column;
  border: 2px solid var(--border);
  list-style: none;
`;

const EventPosterContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

const EventPoster = styled.div`
  width: 100%;
  height: 100%;
  background-color: red;
  object-fit: contain;
  border: 2px solid var(--border);
`;

const EventTitle = styled.h2`
  font-size: 5rem;
  font-weight: 600;
`;

function Event(
  {
    /* title, poster, info */
  }
) {
  const Events = styled.ul`
    display: flex;
    flex-direction: column;
    width: 100vw;
    height: calc(300vh - 36rem);
    gap: 1rem;
    background-color: white;
  `;
  return (
    <div id="GlobalContainer">
      <EventsHeader>이벤트 목록</EventsHeader>
      <Events>
        <EventContainer>Monn&Tree x Magicclub Close-up Workshop</EventContainer>
        <EventContainer>Party</EventContainer>
        <EventContainer>5월 공연</EventContainer>
